usercontent.com/PokeAPI/sprites/master/sprites/items/red-card.png','held-items'),('ring-target','Held : When one of the user’s types would render it immune to damage, that type is ignored for damage calculation.',_binary '\0','Moves that would otherwise have no effect will land on the Pokémon that holds it.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/ring-target.png','held-items'),('rocky-helmet','Held : When the holder is hit by a contact move, the attacking Pokémon takes 1/6 its max HP in damage.',_binary '\0','If the holder of this item takes damage, the attacker will also be damaged upon contact.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/rocky-helmet.png','held-items'),('room-service','',_binary '\0','An item to be held by a Pokémon. Lowers Speed when Trick Room takes effect.','null','held-items'),('sablenite','Held: Allows Sableye to Mega Evolve into Mega Sableye.',_binary '','One of a variety of mysterious Mega Stones. Have Sableye hold it, and this stone will enable it to Mega Evolve during battle.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/sablenite.png','mega-stones'),('safety-goggles','Held: Prevents damage from powder moves and the damage from Hail and Sandstorm.',_binary '\0','An item to be held by a Pokémon. These goggles protect the holder from both weather-related damage and powder.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/safety-goggles.png','held-items'),('salamencite','Held: Allows Salamence to Mega Evolve into Mega Salamence.',_binary '','One of a variety of mysterious Mega Stones. Have Salamence hold it, and this stone will enable it to Mega Evolve during battle.','https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/items/salamencite.png','mega-stones'),('sceptilite','Held: Allows Sceptile to Mega Evolve into Mega Sceptile.',_binary '','One of a variety of mysterious Mega Stones. Have Sceptile hold it, and this