'The lower half of its body is wrapped in a cloud of energy. It zooms through the sky at 200 mph.'),(642,'Thundurus','Electric','Flying',79,115,70,125,80,111,_binary '','Countless charred remains mar the landscape of places through which Thundurus has passed.'),(643,'Reshiram','Dragon','Fire',100,120,100,150,120,90,_binary '','This Pokémon appears in legends. It sends flames into the air from its tail, burning up everything around it.'),(644,'Zekrom','Dragon','Electric',100,150,120,120,100,90,_binary '','Concealing itself in lightning clouds, it flies throughout the Unova region. It creates electricity in its tail.'),(645,'Landorus','Ground','Flying',89,125,90,115,80,101,_binary '','Lands visited by Landorus grant such bountiful crops that it has been hailed as “The Guardian of the Fields.”'),(646,'Kyurem','Dragon','Ice',125,130,90,130,90,95,_binary '','It generates a powerful, freezing energy inside itself, but its body became frozen when the energy leaked out.'),(647,'Keldeo','Water','Fighting',91,72,90,129,90,108,_binary '\0','By blasting water from its hooves, it can glide across water. It excels at using leg moves while battling.'),(648,'Meloetta','Normal','Psychic',100,77,77,128,128,90,_binary '\0','Its melodies are sung with a special vocalization method that can control the feelings of those who hear it.'),(649,'Genesect','Bug','Steel',71,120,95,120,95,99,_binary '\0','Over 300 million years ago, it was feared as the strongest of hunters. It has been modified by Team Plasma.'),(650,'Chespin','Grass','',56,61,65,48,45,38,_binary '\0','The quills on its head are usually soft. When it flexes them, the points become so hard and sharp that they can pierce rock.'),(651,'Quilladin','Grass','',61,78,95,56,58,57,_binary '\0','It relies on its sturdy shell to deflect predators’ attacks. It counterattacks with its sharp quills.'),(652,'Chesnaught','Grass','Fighting',88,107,122,74,75,64,_binary '\0','Its Tackle is forceful enough to flip a 50-ton tank. It shields its allies from danger with its own body.'),(653,'Fennekin','Fire','',40,45,40,62,60,60,_binary '\0','Eating a twig fills it with energy, and its roomy ears give vent to air hotter than 390 degrees Fahrenheit.'),(654,'Braixen','Fire','',59,59,58,90,70,73,_binary '\0','It has a twig stuck in its tail. With friction from its tail fur, it sets the twig on fire and launches into battle.'),(655,'Delphox','Fire','Psychic',75,69,72,114,100,104,_binary '\0','It gazes into the flame at the tip of its branch to achieve a focused state, which allows it to see into the future.'),(656,'Froakie','Water','',41,56,40,62,44,71,_binary '\0','It secretes flexible bubbles from its chest and back. The bubbles reduce the damage it would otherwise take when attacked.'),(657,'Frogadier','Water','',54,63,52,83,56,97,_binary '\0','It can throw bubble-covered pebbles with precise control, hitting empty cans up to a hundred feet away.'),(658,'Greninja','Water','Dark',72,95,67,103,71,122,_binary '\0','It creates throwing stars out of compressed water. When it spins them and throws them at high speed, these stars can split metal in two.'),(659,'Bunnelby','Normal','',38,36,38,32,36,57,_binary '\0','They use their large ears to dig burrows. They will dig the whole night through.'),(660,'Diggersby','Normal','Ground',85,56,77,50,77,78,_binary '\0','With their powerful ears, they can heft boulders of a ton or more with ease. They can be a big help at construction sites.'),(661,'Fletchling','Normal','Flying',45,50,43,40,38,62,_binary '\0','These friendly Pokémon send signals to one another with beautiful chirps and tail-feather movements.'),(662,'Fletchinder','Fire','Flying',62,73,55,56,52,84,_binary '\0','From its beak, it expels embers that set the tall grass on fire. Then it pounces on the bewildered prey that pop out of the grass.'),(663,'Talonflame','Fire','Flying',78,81,71,74,69,126,_binary '\0','In the fever of an exciting battle, it showers embers from the gaps between its feathers and takes to the air.'),(664,'Scatterbug','Bug','',38,35,40,27,25,35,_binary '\0','When under attack from bird Pokémon, it spews a poisonous black powder that causes paralysis on contact.'),(665,'Spewpa','Bug','',45,22,60,27,30,29,_binary '\0','It lives hidden within thicket shadows. When predators attack, it quickly bristles the fur covering its body in an effort to threaten them.'),(666,'Vivillon','Bug','Flying',80,52,50,90,50,89,_binary '\0','Vivillon with many different patterns are found all over the world. These patterns are affected by the climate of their habitat.'),(667,'Litleo','Fire','Normal',62,50,58,73,54,72,_binary '\0','The stronger the opponent it faces, the more heat surges from its mane and the more power flows through its body.'),(668,'Pyroar','Fire','Normal',86,68,72,109,66,106,_binary '\0','The male with the largest mane of fire is the leader of the pride.'),(669,'Flabébé','Fairy','',44,38,39,61,79,42,_binary '\0','It draws out and controls the hidden power of flowers. The flower Flabébé holds is most likely part of its body.'),(670,'Floette','Fairy','',54,45,47,75,98,52,_binary '\0','It flutters around fields of flowers and cares for flowers that are starting to wilt. It draws out the hidden power of flowers to battle.'),(671,'Florges','Fairy','',78,65,68,112,154,75,_binary '\0','It claims exquisite flower gardens as its territory, and it obtains power from basking in the energy emitted by flowering plants.'),(672,'Skiddo','Grass','',66,65,48,62,57,52,_binary '\0','Thought to be one of the first Pokémon to live in harmony with humans, it has a placid disposition.'),(673,'Gogoat','Grass','',123,100,62,97,81,68,_binary '\0','It can tell how its Trainer is feeling by subtle shifts in the grip on its horns. This empathic sense lets them run as if one being.'),(674,'Pancham','Fighting','',67,82,62,46,48,43,_binary '\0','It does its best to be taken seriously by its enemies, but its glare is not sufficiently intimidating. Chewing on a leaf is its trademark.'),(675,'Pangoro','Fighting','Dark',95,124,78,69,71,58,_binary '\0','Although it possesses a violent temperament, it won’t put up with bullying. It uses the leaf in its mouth to sense the movements of its enemies.'),(676,'Furfrou','Normal','',75,80,60,65,90,102,_binary '\0','Trimming its fluffy fur not only makes it more elegant but also increases the swiftness of its movements.'),(677,'Espurr','Psychic','',62,48,54,63,60,68,_binary '\0','The organ that emits its intense psychic power is sheltered by its ears to keep power from leaking out.'),(678,'Meowstic','Psychic','',74,48,76,83,81,104,_binary '\0','When in danger, it raises its ears and releases enough psychic power to grind a 10-ton truck into dust.'),(679,'Honedge','Steel','Ghost',45,80,100,35,37,28,_binary '\0','Apparently this Pokémon is born when a departed spirit inhabits a sword. It attaches itself to people and drinks their life force.'),(680,'Doublade','Steel','Ghost',59,110,150,45,49,35,_binary '\0','When Honedge evolves, it divides into two swords, which cooperate via telepathy to coordinate attacks and slash their enemies to ribbons.'),(681,'Aegislash','Steel','Ghost',60,150,50,150,50,60,_binary '\0','Generations of kings were attended by these Pokémon, which used their spectral power to manipulate and control people and Pokémon.'),(682,'Spritzee','Fairy','',78,52,60,63,65,23,_binary '\0','It emits a scent that enraptures those who smell it. This fragrance changes depending on what it has eaten.'),(683,'Aromatisse','Fairy','',101,72,72,99,89,29,_binary '\0','It devises various scents, pleasant and unpleasant, and emits scents that its enemies dislike in order to gain an edge in battle.'),(684,'Swirlix','Fairy','',62,48,66,59,57,49,_binary '\0','To entangle its opponents in battle, it extrudes white threads as sweet and sticky as cotton candy.'),(685,'Slurpuff','Fairy','',82,80,86,85,75,72,_binary '\0','It can distinguish the faintest of scents. It puts its sensitive sense of smell to use by helping pastry chefs in their work.'),(686,'Inkay','Dark','Psychic',53,54,53,37,46,45,_binary '\0','Opponents who stare at the flashing of the light-emitting spots on its body become dazed and lose their will to fight.'),(687,'Malamar','Dark','Psychic',86,92,88,68,75,73,_binary '\0','It wields the most compelling hypnotic powers of any Pokémon, and it forces others to do whatever it wants.'),(688,'Binacle','Rock','Water',42,52,67,39,56,50,_binary '\0','Two Binacle live together on one rock. When they fight, one of them will move to a different rock.'),(689,'Barbaracle','Rock','Water',72,105,115,54,86,68,_binary '\0','When they evolve, two Binacle multiply into seven. They fight with the power of seven Binacle.'),(690,'Skrelp','Poison','Water',50,60,60,60,60,30,_binary '\0','Camouflaged as rotten kelp, they spray liquid poison on prey that approaches unawares and then finish it off.'),(691,'Dragalge','Poison','Dragon',65,75,90,97,123,44,_binary '\0','Their poison is strong enough to eat through the hull of a tanker, and they spit it indiscriminately at anything that enters their territory.'),(692,'Clauncher','Water','',50,53,62,58,63,44,_binary '\0','They knock down flying prey by firing compressed water from their massive claws like shooting a pistol.'),(693,'Clawitzer','Water','',71,73,88,120,89,59,_binary '\0','Their enormous claws launch cannonballs of water powerful enough to pierce tanker hulls.'),(694,'Helioptile','Electric','Normal',44,38,33,61,43,70,_binary '\0','They make their home in deserts. They can generate their energy from basking in the sun, so eating food is not a requirement.'),(695,'Heliolisk','Electric','Normal',62,55,52,109,94,109,_binary '\0','They flare their frills and generate energy. A single Heliolisk can generate sufficient electricity to power a skyscraper.'),(696,'Tyrunt','Rock','Dragon',58,89,77,45,45,48,_binary '\0','This Pokémon was restored from a fossil. If something happens that it doesn’t like, it throws a tantrum and runs wild.'),(697,'Tyrantrum','Rock','Dragon',82,121,119,69,59,71,_binary '\0','Thanks to its gargantuan jaws, which could shred thick metal plates as if they were paper, it was invincible in the ancient world it once inhabited.'),(698,'Amaura','Rock','Ice',77,59,50,67,63,46,_binary '\0','This ancient Pokémon was restored from part of its body that had been frozen in ice for over 100 million years.'),(699,'Aurorus','Rock','Ice',123,77,72,99,92,58,_binary '\0','The diamond-shaped crystals on its body expel air as cold as -240 degrees Fahrenheit, surrounding its enemies and encasing them in ice.'),(700,'Sylveon','Fairy','',95,65,65,110,130,60,_binary '\0','It sends a soothing aura from its ribbonlike feelers to calm fights.'),(701,'Hawlucha','Fighting','Flying',78,92,75,74,63,118,_binary '\0','Although its body is small, its proficient fighting skills enable it to keep up with big bruisers like Machamp and Hariyama.'),(702,'Dedenne','Electric','Fairy',67,58,57,81,67,101,_binary '\0','Its whiskers serve as antennas. By sending and receiving electrical waves, it can communicate with others over vast distances.'),(703,'Carbink','Rock','Fairy',50,50,150,50,150,50,_binary '\0','Born from the temperatures and pressures deep underground, it fires beams from the stone in its head.'),(704,'Goomy','Dragon','',45,50,35,55,75,40,_binary '\0','The weakest Dragon-type Pokémon, it lives in damp, shady places, so its body doesn’t dry out.'),(705,'Sliggoo','Dragon','',68,75,53,83,113,60,_binary '\0','It drives away opponents by excreting a sticky liquid that can dissolve anything. Its eyes devolved, so it can’t see anything.'),(706,'Goodra','Dragon','',90,100,70,110,150,80,_binary '\0','This very friendly Dragon-type Pokémon will hug its beloved Trainer, leaving that Trainer covered in sticky slime.'),(707,'Klefki','Steel','Fairy',57,80,91,80,87,75,_binary '\0','These key collectors threaten any attackers by fiercely jingling their keys at them.'),(708,'Phantump','Ghost','Grass',43,70,48,50,60,38,_binary '\0','These Pokémon are created when spirits possess rotten tree stumps. They prefer to live in abandoned forests.'),(709,'Trevenant','Ghost','Grass',85,110,76,65,82,56,_binary '\0','It can control trees at will. It will trap people who harm the forest, so they can never leave.'),(710,'Pumpkaboo','Ghost','Grass',49,66,70,44,55,51,_binary '\0','The pumpkin body is inhabited by a spirit trapped in this world. As the sun sets, it becomes restless and active.'),(711,'Gourgeist','Ghost','Grass',65,90,122,58,75,84,_binary '\0','Singing in eerie voices, they wander town streets on the night of the new moon. Anyone who hears their song is cursed.'),(712,'Bergmite','Ice','',55,69,85,32,35,28,_binary '\0','It blocks opponents’ attacks with the ice that shields its body. It uses cold air to repair any cracks with new ice.'),(713,'Avalugg','Ice','',95,117,184,44,46,28,_binary '\0','Its ice-covered body is as hard as steel. Its cumbersome frame crushes anything that stands in its way.'),(714,'Noibat','Flying','Dragon',40,30,35,45,40,55,_binary '\0','They live in pitch-black caves. Their enormous ears can emit ultrasonic waves of 200,000 hertz.'),(715,'Noivern','Flying','Dragon',85,70,80,97,80,123,_binary '\0','They fly around on moonless nights and attack careless prey. Nothing can beat them in a battle in the dark.'),(716,'Xerneas','Fairy','',126,131,95,131,98,99,_binary '','Legends say it can share eternal life. It slept for a thousand years in the form of a tree before its revival.'),(717,'Yveltal','Dark','Flying',126,131,95,131,98,99,_binary '','When this legendary Pokémon’s wings and tail feathers spread wide and glow red, it absorbs the life force of living creatures.'),(718,'Zygarde','Dragon','Ground',108,100,121,81,95,95,_binary '','When the Kalos region’s ecosystem falls into disarray, it appears and reveals its secret power.'),(719,'Diancie','Rock','Fairy',50,100,150,100,150,50,_binary '','A sudden transformation of Carbink, its pink, glimmering body is said to be the loveliest sight in the whole world.'),(720,'Hoopa','Psychic','Ghost',80,110,60,150,130,70,_binary '','This troublemaker sends anything and everything to faraway places using its loop, which can warp space.'),(721,'Volcanion','Fire','Water',80,110,120,130,90,70,_binary '','It lets out billows of steam and disappears into the dense fog. It’s said to live in mountains where humans do not tread.');
