  `atk` int NOT NULL,
  `def` int NOT NULL,
  `spAtk` int NOT NULL,
  `spDef` int NOT NULL,
  `speed` int NOT NULL,
  `mega` bit(1) NOT NULL,
  `description` varchar(300) DEFAULT NULL,
  `img_suffix` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`name`),
  KEY `pID` (`pID`),
  KEY `type1` (`type1`),
  KEY `type2` (`type2`),
  CONSTRAINT `pokemonvariants_ibfk_1` FOREIGN KEY (`pID`) REFERENCES `pokedex` (`pID`) ON DELETE CASCADE,
  CONSTRAINT `pokemonvariants_ibfk_2` FOREIGN KEY (`type1`) REFERENCES `types` (`type`),
  CONSTRAINT `pokemonvariants_ibfk_3` FOREIGN KEY (`type2`) REFERENCES `types` (`type`)
